import React, { Component } from 'react';
import axios from 'axios';

class Tracker extends Component {
    state = { 
        platform:''
        
    }
    
    componentDidMount() {
    axios.get(`http://localhost:5000/api/v1/profile/`)
    .then(res => res.json())
      .then(res => this.setState({platform: res.data}
       )
      )}
      
    render() { 
        return ( <div className="nav" >
        <h1>Tracker</h1>
        <label for="platform">Choose Platform: </label>
        <select id="platform">
  <option value="psn" onSelect={this.setState({platform: this.state.platform} )} value="psn">Playstation</option>

  <option value="xbl" onSelect={this.setState({platform: this.state.platform} )}  value="xbl">Xbox</option>

  <option value="origin" onSelect={this.setState({platform: this.state.platform} )}  value="origin">Origin</option>
</select>
<br></br>
        <label for="username">Username: </label>
        <input id="username" placeholder="Enter Username"/>
        <button >Submit</button>
        {/* <form>
            <ul>
                {this.state.users.map(platform => <li key={platform.id}></li>)}
            </ul>
        </form> */}
        </div> );
    }
}
 
export default Tracker;
